import React from "react";
import { animated } from "react-spring";

interface PropTypes {
  animatedSidebar: any;
}

const Sidebar: React.FC<PropTypes> = ({ animatedSidebar }) => {
  return <animated.div style={animatedSidebar}>HI</animated.div>;
};

export default Sidebar;
